                stack.push(")");
                if (stack.size() % 2 == 0) {
                    while (!stack.peek().equals("(")) {
                        stack.addFirst(stack.pollLast());
                    }
                    stack.pollLast(); // remove "("
                    StringBuilder group = new StringBuilder();
                    while (!stack.isEmpty()) {
                        group.insert(0, stack.pollLast());
                    }
                    result.add(group.toString());
                }
            }
        }
        return result;

