    public static long howManyTimes(String string, String substring) {
        int count = 0;
        int lastIndex = 0;
        while(lastIndex != -1){
            lastIndex = string.indexOf(substring,lastIndex);
            if(lastIndex != -1){
                count ++;
                lastIndex += substring.length();
            }
        }
        return count;

